// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";

contract TokenVestingBurnForging is Ownable {
    using SafeMath for uint256;
    using SafeERC20 for IERC20;

    event TokensReleased(address token, uint256 amount);

    // 受益人地址
    address public burner;
    // UNIX time，UTC时间戳，单位秒，类型uint，与 block.timestamp 一致
    // 合约开始时间，即锁定开始时间
    uint256 public start;
    // 锁定周期，例如：4年
    uint256 public duration;
    // 每阶段截断时间单位
    uint256 public stageCliffUnit;
    // 总释放比例
    uint256 public totalShares = 100;
    // 锻造数量
    uint256 public burnedAmount;
    // 返还数量
    uint256 public receiveAmount;

    // 记录每个币种的已释放量
    mapping (address => uint256) public released;

    constructor (address _burner, uint256 _start, uint256 _duration, uint256 _stageCliffUnit, uint256 _burnedAmount, uint256 _receiveAmount) {
        require(_burner != address(0), "TokenVestingBurnForging: burner is the zero address");
        require(_start.add(_duration) > block.timestamp, "TokenVestingBurnForging: final time is before current time");
        require(_duration >= _stageCliffUnit, "TokenVestingBurnForging: Period is greater than unit time");

        burner = _burner;
        start = _start;
        duration = _duration;
        stageCliffUnit = _stageCliffUnit;
        burnedAmount = _burnedAmount;
        receiveAmount = _receiveAmount;
    }

    // 提取代币
    function release(IERC20 token) public {
        uint256 unreleased = releasableAmount(token);
        require(unreleased > 0, "TokenVestingBurnForging: no tokens are due");
        released[address(token)] = released[address(token)].add(unreleased);
        token.safeTransfer(burner, unreleased);
        emit TokensReleased(address(token), unreleased);
    }

    // 计算可提取代币数量
    function releasableAmount(IERC20 token) public view returns (uint256) {
        return _vestedAmount(token).sub(released[address(token)]);
    }

    // 计算已释放代币数量
    function _vestedAmount(IERC20 token) private view returns (uint256) {
        uint256 currentBalance = token.balanceOf(address(this));
        uint256 totalBalance = currentBalance.add(released[address(token)]);

        // 按条件计算已释放代币数量
        if (block.timestamp >= start.add(duration)) {
            return totalBalance;
        } else {
            // 记录已释放代币数量
            uint256 vestedAmount = 0;
            // 累计释放时间
            uint256 cumulativeTime = start;
            // 计算每阶段释放次数
            uint256 vestCount = duration.div(stageCliffUnit);
            for (uint256 i = 0; i < vestCount; i++) {
                cumulativeTime = cumulativeTime.add(stageCliffUnit);
                if (cumulativeTime > block.timestamp) {
                    break;
                }
                vestedAmount = vestedAmount.add(totalBalance.div(vestCount));
            }
            return vestedAmount;
        }
    }
}
